impl Solution {
    pub fn minimum_operations(num: String) -> i32 {
        let bytes = num.as_bytes();
        let n = bytes.len();
        let mut result = i32::MAX;

        for target in [25, 50, 75, 0].iter() {
            let (mut i, mut j) = (n as i32 - 1, 2);
            let mut ops = 0;
            while i >= 0 && j > 0 {
                let digit = (target / 10_i32.pow(2 - j)) % 10;
                if bytes[i as usize] as i32 - b'0' as i32 == digit {
                    j -= 1;
                } else {
                    ops += 1;
                }
                i -= 1;
            }
            if j == 0 {
                result = result.min(ops + i + 1);
            } else if *target == 0 && j == 2 {
                result = result.min(n as i32 - 1);
            }
        }
        result
    }
}
